import React from 'react';
import './App.css';
import DataVisualization from './components/DataVisualization';
import { ThemeProvider } from '@mui/material/styles';
import theme from './theme/theme';
import CssBaseline from '@mui/material/CssBaseline';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import Paper from '@mui/material/Paper';
import MapComponent from './components/MapComponent';
import DemographicsPieChart from './components/DemographicsPieChart';

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="static" color="primary">
        <Toolbar>
          <Typography variant="h6" color="inherit">
            Welcome to Nest Quest
          </Typography>
        </Toolbar>
      </AppBar>
      <Container maxWidth="lg">
        <Box my={4}>
          <Paper elevation={3}>
            <Box
              p={3}
              style={{
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
                width: '100%', // Ensure the box takes the full width
              }}
            >
              <div style={{ width: '100%', maxWidth: '1100px' }}>
                {' '}
                <DataVisualization />
              </div>
              {/* Center the MapComponent */}
              <div
                style={{
                  width: '100%',
                  display: 'flex',
                  justifyContent: 'center',
                  alignItems: 'center',
                }}
              >
                <MapComponent />
              </div>
            </Box>

            <Box style={{ display: 'flex', justifyContent: 'center' }}>
              <DemographicsPieChart />
            </Box>
          </Paper>
        </Box>
      </Container>
      <Box mt={5} py={3} bgcolor="primary.main" color="primary.contrastText">
        <Container maxWidth="lg">
          <Typography variant="body1">Nest Quest Â©2024</Typography>
        </Container>
      </Box>
    </ThemeProvider>
  );
}

export default App;
